import Logo from '../svgs/lofisoul.svg';
import styled from 'styled-components';


const StyledLogo = styled.h1`
    margin:0;
    & Logo {
        width:100%;
        height:auto;
    }
`

const Header = () => (
    <header><h1><StyledLogo /></h1></header>
)

export default Header;
